eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n// Module\nvar code = \"<hr>\\n<p>title: 2023 중간 회고\\nsubTitle: 번아웃의 탈을 쓴 게으름\\ndate: 2023-07-15</p>\\n<hr>\\n<h2 id=\\\"오랜만에-쓰는-회고\\\">오랜만에 쓰는 회고</h2>\\n<p>대학생의 하루는 짧기만 하다. 하고 싶었던건 많고, 해야할 것들은 더 많았던 학기중이 지나고 방학을 맞아 숨을 돌리고 있다. 마음껏 방탕(?)하게 즐기던 방학도 슬슬 반환점을 돌 무렵 적어보는 중간 회고. 올해는 어떤 것들을 했을까?</p>\\n<h2 id=\\\"4학년이-되어가는-과정\\\">4학년이 되어가는 과정</h2>\\n<p>군휴학을 포함한 이런저런 휴학들로 살짝 엇박자를 타게 된 나에게 2023년의 1학기는 일곱번째 학기, 즉 3학년 2학기 과정이었다. 딱히 들을만한 교양도 없고(<strong>리터럴리</strong> 없다. 다른 학교들에 비해 개설된 교양 과목 수가 유독 적었다!), 일찍이 전공 위주로 수업을 들어왔던터라 무난히만 가면 졸업을 위한 전공 학점은 충분히 채울 수 있는 상황이었기에, 이번 학기는 정말 듣고 싶은 강의들을 위주로 들어보자는 생각이었다.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/09138831-8ccc-4394-a95f-3ffc8e4b5a96\\\" alt=\\\"image\\\"></p>\\n<p>네트워크 쪽 보안이 궁금해서 들었던 정보보호론과 졸업 필수였던 캡스톤디자인(1) 을 제외하면 모두 교양이었다. &quot;인공지능의수학과과학&quot; 도 전공 같은 이름이지만 들을게 없어서 빈 공간에 급하게 끼워넣은 교양과목이다.</p>\\n<p>평소에 음악을 좋아해서 들어본 <strong>음악의 이해</strong> 도 재미있었고, 고등학교 제2 외국어 단골 손님이었던 <strong>일본어(1)</strong> 도 기본적인 읽고 쓰기 정도는 하고 싶어서 수강했다. 나름 열심히 수업도 듣고 공부도 했다고 생각했는데, 기초 과목인데도 원어민들과 자유롭게 대화할 수 있는 수준의 학생들이 많았는지 학점은... 😂 분명 7~80%의 문제를 맞혔는데도 평균 아래로 점수가 내려가는걸 보고 깜짝 놀랐다. 정말 대단한 학생들이구나.</p>\\n<p><strong>캡스톤디자인(1)</strong> 으로는 졸업 과제를 만들게 되었는데, 1인 팀으로 구성해서 웹 기반 스터디 정보 및 관리 플랫폼을 하나 만들었다. 프론트엔드만 하다가 백엔드까지 다 해보려니 어색했지만, 새로운 기술을 배우고 무엇인가를 만드는 과정 자체를 즐기는 성향이라 재밌게 진행했다. 역시 단순한 수업보다는 프로젝트가 더 잘 맞는듯 하다. 다음 학기에 (2) 과목을 수강하며 졸업 과제로 완성시킬 계획이다.</p>\\n<p><strong>최종 성적</strong></p>\\n<ul>\\n<li>음악의 이해: A0</li>\\n<li>일본어(1): B0</li>\\n<li>캡스톤디자인(1): A+</li>\\n</ul>\\n<h2 id=\\\"아르바이트\\\">아르바이트</h2>\\n<p>등록금과 용돈 벌이를 위해 아르바이트를 시작했다. 서초 소재 IDC 센터에 입주한 모 서버 호스팅 회사에서 근무하게 되었는데, 평일 하루, 주말 이틀 간 근무라 학교 스케쥴과 겹치지 않아 병행하기 딱 좋았다. 단점이라면 온전히 쉬는 날이 하루라는 점이나 주말에 개인적인 약속 잡기가 어렵다는 정도? 그 외에는 근무 환경이나 급여 수준도 나쁘지 않았다.</p>\\n<p>아, 근무지가 강남에 있다보니 집에서 거리가 좀 있다는 점도 단점이다. 쓰고 나니 생각보다 단점이 많긴 한데 일이 별로 어렵지 않아서 체감상으론 괜찮은것 같다. 무엇보다 학교랑 병행이 된다는게 너무 큰 메리트라... 올해 말에 취업하기 전까지만 다닐 계획이다.</p>\\n<p>나름 전공을 살릴 수 있는 업무라는 것도 장점이다. 서버 관련 업체이다보니 Cent OS나 Rocky linux, Windows Server 등 운영체제도 만지고, 네트워크 설정도 건드려보고, 가끔 랜 케이블도 따고... 이건 전공보다는 통신병 경험을 살린 케이스긴 하지만.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/d650a935-57c4-4d66-85ff-822156e53bea\\\" alt=\\\"image\\\"></p>\\n<p>아르바이트를 하며 서버들을 매일같이 보고 있던 탓인지 요새는 개인 서버를 하나 갖고 싶다는 생각이 무럭무럭 들고 있다. 아무튼 만족스럽다.</p>\\n<h2 id=\\\"알고리즘\\\">알고리즘</h2>\\n<p>코딩테스트 대비도 하고, 아직 학생일때 <a href=\\\"https://solved.ac/\\\">solved.ac</a> 기준으로 플래티넘 티어를 달아보고 싶은 개인적인 욕심이 생겨서 하루에 하나씩 알고리즘 문제를 풀기로 했다.</p>\\n<p>어떤 언어를 사용할지도 고민이 들었는데, 이전까지 사용하던 C++을 그대로 사용하자니 일반적인 알고리즘 문제를 풀기엔 입출력이나 자료형 등 고려해야할 것들이 많아서 편하게 쓸 수 있는 파이썬을 사용하기로 했다. 자바스크립트를 썼다면 더 좋았겠지만 백준은 프로그래머스 같지 않아서 불편함이 있다.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/f9e18a47-eea0-48dc-9aec-d24aa614e2ff\\\" alt=\\\"image\\\"></p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/76d913cc-2b0c-46e4-b5b0-d63eaf69b9ba\\\" alt=\\\"image\\\"></p>\\n<p>올해 처음 시작했을때부터 이 글을 쓰고있는 2023년 7월 15일까지 126일정도 지났고, 레이팅은 300점 정도 올랐다. 점수가 높다고 꼭 잘하는건 아니지만 꾸준하게 해왔다는 점 자체만으로도 나름 만족스러운 결과였다.</p>\\n<p>이전에 공부했다가 잊어버린 부분도, 새롭게 알게된 부분도 많아서 이따금 블로그에 정리해두었다. 하루에 하나씩이었지만 점차 쌓이다보니 여러모로 많은 도움이 되었다.</p>\\n<h2 id=\\\"면허\\\">면허</h2>\\n<p>미루고 미루던 운전 면허를 드디어 땄다. 다른 학교보다 방학도 일찍 했겠다, 사람이 없을때 얼른 학원에 등록하고 2 ~ 3주만에 2종 보통으로 취득했다.</p>\\n<p>처음엔 나같은 초보가 도로에 가면 민폐가 아닐까 막연하게 걱정했는데 계속 하다보니 자신감도 생기고 재미도 붙인것같다. 아마 다음 운전은 명절때나 하게되지 않을까. 그때까지 연습이나 좀 해둘 예정.</p>\\n<h2 id=\\\"오픈소스\\\">오픈소스</h2>\\n<p><a href=\\\"https://react.dev/\\\">리액트 베타 문서</a>의 한국어 번역자를 구한다는 말을 듣고, 비어있던 문서 하나를 할당받아 작업했다. 이전에도 MDN 문서나 Toss slash 문서들을 번역하거나 수정하기도 했었는데, 이번엔 리액트의 공식 문서라니 감회가 새롭다. 이제는 deprecated 되어 거의 사용하지 않는 API긴 하지만 조금이나마 내가 몸 담고 있는 생태계에 기여했다는 점에서는 내심 뿌듯하기도 하다.</p>\\n<p>언젠간 나도 문서가 아닌 코드로도 오픈소스에 기여할 수 있겠지? 생각만해도 짜릿하다.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/f750b321-9df1-4b53-9440-3ca435e900b4\\\" alt=\\\"image\\\"></p>\\n<ul>\\n<li><a href=\\\"https://react.dev/reference/react-dom/findDOMNode\\\">findDOMNode - React</a></li>\\n</ul>\\n<h2 id=\\\"블로깅과-한-주-한-글\\\">블로깅과 한 주 한 글</h2>\\n<p>올해도 <a href=\\\"https://usage.tistory.com\\\">블로그</a>는 꾸준히 했다. 못해도 매주 하나씩의 글은 올렸었는데, 혼자만 했다면 아마 못했을거다. 동아리 선후배들과 함께 한 주에 하나씩 글을 쓰는 작은 모임을 만들어서 진행했는데, 이 모임의 공이 컸다.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/67a2db51-aba7-4cf7-a212-0f7cb4e02fcc\\\" alt=\\\"image\\\"></p>\\n<p>뜨거운 성원(?) 덕분에 겨울방학 기간동안 진행된 1기에 이어 1학기중에 2기까지 진행하고, 오는 8월부터는 3기를 진행할 예정이다.</p>\\n<p>2기가 끝나고는 간단히 모여서 뒤풀이 시간도 가졌는데, 다른 친구들은 어떨지 모르겠지만 개인적으로는 굉장히 만족스러웠다. 기수를 거듭할수록 구성원들이 더 다양한 사람들과 만나고, 새로운 경험을 할 수 있는 성숙한 모임으로 키워갔으면 하는 바람이 있다.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/87db5e2f-f1b9-44a4-8348-e9c8fce85003\\\" alt=\\\"image\\\"></p>\\n<h2 id=\\\"개인-프로젝트\\\">개인 프로젝트</h2>\\n<p>거의 못했다. 이번 회고의 소제목이 <strong>번아웃의 탈을 쓴 게으름</strong>이 된 이유기도 하다. 원래 작년 우테코를 마칠때까지만 해도 하려고 했던 것들이 굉장히 많았다. 개인적으로 만들어서 실서비스를 해보고 싶었던 것도 있었고, 팀으로 모여서 진행하려던 프로젝트도 있었다. 여러가지 사정으로 결과물까지는 나오질 않았지만 😥 (미안해요 조리복!)</p>\\n<p>이제야 좀 여유가 생겨서 지금부터라도 조금씩 다시 만들어보고 있다. 우선 이 블로그부터 Next.js 로 마이그레이션해보고, 개인 서비스도 하나 새로 돌려볼 예정. 공부 좀 열심히 하자.</p>\\n<p><img src=\\\"https://github.com/usageness/blog/assets/28296575/7c485214-9b6a-434a-8c86-6d08dfb8148a\\\" alt=\\\"image\\\"></p>\\n<p>취업준비도 병행해서 하려면 더더더 빡세게 달려야겠다. 제발 올해는 취업 시장이 활발해졌으면 하는 바람이다.</p>\\n<h2 id=\\\"마치며\\\">마치며</h2>\\n<p>이렇게 적고나니 뭔가 많이 한 것도 같긴 한데, 기억상으로는 게으름을 엄청 피웠던것 같아서 기분이 묘하다. 남은 23년은 정말 죽었다고 생각하고 지내봐야지.</p>\\n<p>이 날을 위해 꾸준히 운동하며 체력을 길러뒀으니 걱정은 없다. 골격근량도 36kg 정도로 끌어올려서 인생 최고점도 갱신했겠다, 연말까지 퍼지지 말고 힘내보자!</p>\\n<p>이상 중간 회고 끝. 🖐</p>\\n\";\n// Exports\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (code);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./src/posts/6.md\n");

